svg.script:
    //  
    const OFFSET_X = 80;
    const OFFSET_Y = 45;
    const MAX_X = 2 * OFFSET_X;
    const MAX_Y = 2 * OFFSET_Y;
    const P_LAX_RATIO = 0.8;
    const MOUSE_GRAB_SVG = document.querySelector("#mouseGrabSvg");
    function followMouse(event){
        var m = MOUSE_GRAB_SVG.createSVGPoint();
        m.x = event.clientX;
        m.y = event.clientY;
        m = m.matrixTransform(MOUSE_GRAB_SVG.getScreenCTM().inverse());
        m.x -= OFFSET_X;
        m.y -= OFFSET_Y;
        if (m.x < MAX_X && m.x > -MAX_X && m.y < MAX_Y && m.y > -MAX_Y){
            m.x /= 8;
            m.y /= 8;
            document.querySelector("#starSvgFar").setAttribute("viewBox", `${m.x * Math.pow(P_LAX_RATIO, 4)} ${m.y * Math.pow(P_LAX_RATIO, 4)} ${MAX_X * Math.pow(P_LAX_RATIO, 2) } ${MAX_Y * Math.pow(P_LAX_RATIO, 2)}`);
            document.querySelector("#starSvg").setAttribute("viewBox", `${m.x * Math.pow(P_LAX_RATIO, 2)} ${m.y * Math.pow(P_LAX_RATIO, 2)} ${MAX_X * P_LAX_RATIO} ${MAX_Y * P_LAX_RATIO}`);
            document.querySelector("#starSvgNear").setAttribute("viewBox", `${m.x} ${m.y} ${MAX_X} ${MAX_Y}`);

    const layers = [
        ["#slugRear",  -5],
        ["#slugBody",  -7.5],
        ["#slugFoot", -10],
        ["#slugFace", -12.5],
        ["#slugSlime",-15]
    ];
    for (const [sel, mul] of layers) {
        document.querySelector(sel)
            .setAttribute("viewBox",
                `${m.x * mul - 40} ${m.y * mul - 45} 5333.3 4000`);
    }
            }
        }
    MOUSE_GRAB_SVG.addEventListener("mousemove", followMouse);
//
